import React from 'react';
import './App.css';
import web3 from './web3';
import Accounts from './accounts';
require ('./interface/product_management');

function App() {
  return (
    <div className="App">
      <Accounts />
      <h1>{web3.version}</h1>
    </div>
  );
}

export default App;
